import React from 'react';
import './App.css';
import Navdrawer from './components/navdrawer/navdrawer';
import { Divider} from '@mui/material';
import AccessibleIcon from '@mui/icons-material/Accessible';
import ChildCareIcon from '@mui/icons-material/ChildCare';
import ChildFriendlyIcon from '@mui/icons-material/ChildFriendly';
import EuroIcon from '@mui/icons-material/Euro';
import NavListItem from './components/navListItem/navListItem';

function App() {
  return (
    <div className="App">
      <div className="Background">        
        <Navdrawer name="test" imageLink="https://images-ext-2.discordapp.net/external/NFu54hJJeAEsrCYWF0gaSEAj_Q7qAecwh2J4ZxlZWhE/%3Fsize%3D2048/https/cdn.discordapp.com/avatars/238401356690489344/5eefd320644cfcaf5546ad55ea1ff6a3.png">
          <Divider/>
          <label className="sub">Nieuws Kanalen</label>
          <NavListItem text="Belangrijk Nieuws" icon={<AccessibleIcon />} onClickCommand={() => console.log("Nieuw Icons!")}/>
          <Divider />
          <label className="sub">Chat Kanalen</label>
          <NavListItem text="Publiek" icon={<ChildCareIcon />} onClickCommand={() => console.log("Nieuw Icons!")}/>
          <NavListItem text="Team Genoten" icon={<ChildFriendlyIcon />} onClickCommand={() => console.log("Nieuw Icons!")}/>
          <NavListItem text="one more channel cuz why not" icon={<EuroIcon />}/>
        </Navdrawer>
        <div>
          <h5>Hello World</h5>
        </div>
      </div>
    </div>
  );
}

export default App;
